import React from 'react';
import { Col, Row } from 'reactstrap'

export default function SetSearch(props) {
    return (
        <Container>
            <Row>
                <Col xs="6">
                    <p>  {props.setSearchState.allSets.map(set => set.name)}</p>
                </Col>
            </Row>
        </Container>
    )
}
